import React from "react";
import c from './ProfileFirstBlockImg.module.css'
import imgHead from './../../../../assets/img/header.jpg'

const ProfileFirstBlockImg = () =>{
    return(
        <div className={c.ProfileImg}>
            <img src={imgHead} alt="" />
        </div>
           
    );
}

export default ProfileFirstBlockImg;
